const items = await $input.all();
const out = [];

function stripCodeFence(s) {
  return String(s || '')
    .replace(/^```json\s*/i, '')
    .replace(/^```\s*/i, '')
    .replace(/```$/, '')
    .trim();
}

function firstAuthor(a) {
  if (!a) return null;
  // keep a single name for better "inauthor:" matching
  const s = String(a);
  const parts = s.split(/\s*(?:,| and |&)\s*/i);
  return (parts[0] || '').trim() || null;
}

for (const item of items) {
  let books = null;

  // Case 1: you already have an object with books[]
  if (Array.isArray(item.json?.books)) {
    books = item.json.books;
  }

  // Case 2: you have a string in `content` with ```json ... ```
  if (!books && typeof item.json?.content === 'string') {
    const cleaned = stripCodeFence(item.json.content);
    try {
      const parsed = JSON.parse(cleaned);
      if (Array.isArray(parsed.books)) books = parsed.books;
    } catch (e) {
      // ignore; we'll fall back
    }
  }

  if (!books) continue;

  for (const b of books) {
    out.push({
      json: {
        title: b.title,
        author: b.author ?? null,
        // helper field only for the search query:
        searchAuthor: firstAuthor(b.author)
      }
    });
  }
}

return out;

const items = await $input.all();
const seen = new Set();
const books = [];

for (const it of items) {
  const t = (it.json.title || '').toLowerCase().trim();
  if (t && !seen.has(t)) {
    seen.add(t);
    books.push({ title: it.json.title, author: it.json.author ?? null });
  }
}

return [{ json: { books } }];
